import StarMap from '../components/starmap/StarMap';

const FullMap = () => (
  <StarMap
    mapRange={{ raFrom: 0, raTo: 24, decFrom: -90, decTo: 90 }}
    mapParams={{ limitingMag: 6, ra: 3, dec: 20, aFov: 70 }}
    size={{ width: 300, height: 300 }}
  />
);

export default FullMap;
